import React, { useEffect } from "react";
import { useDispatch } from "react-redux";
import {
  getPokemonName,
  getPokemons,
  getPokemonsId,
  getTypes,
} from "../../actions";

export default function Home() {
  const dispatchPokes = useDispatch(getPokemons());
  const dipatchPokeId = useDispatch(getPokemonsId());
  const dispatchPokeName = useDispatch(getPokemonName());
  const dispatchTypes = useDispatch(getTypes());

  const pokemons = useSelector(state);

  useEffect(() => {
    dispatchPokes();
  }, []);

  return (
    <div className="container">
      <div>
        <h1>Pokemons</h1>
      </div>
      <Pokemons />
    </div>
  );
}
